ProductName-GreenTea
QuantityPerUnit-100
UnitsOnOrder-20
CategoryID-1
(Note:Use ProductID as 7,8,9 respectively and Discontinued as 0 for all 3 records)
*/

insert into Products (ProductID,ProductName,QuantityPerUnit,UnitsOnOrder,CategoryID) values(7,'GreenTea',100,20,1);
