insert into Customers (CustomerID,CompanyName,ContactName,City,Phone)values('Arun','DEF','Kumar','Mexico','(5) 555-4729');

/*update CompanyName as 'DHL' in Shippers table where the shipperid is 1*/
update Shippers set CompanyName='DHL' where shipperid=1;

/*Write a Sql Query to Update book title as 'PHYSICS Volume - I' in books table where book title is 'PHYSICS - I'*/

update books set [book title] = 'PHYSICS Volume - I' where [book title] = 'PHYSICS - I';


/*update city as 'Portland' in suppliers table where companyname is 'Bigfoot Breweries'*/
update suppliers set city = 'Portland' where companyname='Bigfoot Breweries'

/*update department head as 'HUMANITIES' in departments table where department name is english*/
update departments set [department head] = 'HUMANITIES' where [department name] = 'english'


/*Write a Sql Query Update book Class as 'ASST. LECTURER' in Student_Details table where Class is 'LECTURER'*/

UPDATE Student_Details set [book Class] = 'ASST. LECTURER' where Class = 'LECTURER';


/*update the ShipCountry as UnitedStates in orders table where ShipRegion is WA*/

UPDATE orders set ShipCountry = 'UnitedStates' where ShipRegion = 'WA';


/*Update Products table with CategoryID as 2 for the Product Ketchup*/

UPDATE Products set CategoryID = 2 where Product ='Ketchup';


/*Modify the Description for Condiments as Sweet and savory sauces,seasonings in Categories table*/

UPDATE Categories set description = 'Sweet and savory sauces,seasonings' where name='Condiments';


/*Modify ContactName as Andrew for Company DEF in Customers table*/

UPDATE Customers set ContactName = 'Andrew' where Company='DEF';


/*Delete values from Patient_Medical_Record table whose patient_id is 2*/

DELETE FROM Patient_Medical_Record where patient_id = 2;


/*Delete all transactions for transactiontype 'I' in book_transaction table*/

DELETE FROM book_transaction where transactiontype='I';


/*delete values from EmployeeTerritories table whose territoryid is 55439*/

DELETE FROM  EmployeeTerritories where territoryid =55439;


/*delete the records whose name starts with 'M' from student_details table*/

DELETE FROM student_details where name like 'M%';


/*Delete records whose UnitsInOrder is below 20 From Products table*/

DELETE FROM Products where  UnitsInOrder<20;


/*Delete records of whose Subtotal greater than 200 from Summary of Sales by Year table*/

DELETE FROM [Summary of Sales by Year] where Subtotal>200;


/*Write a query to find ContactName, CompanyName, and Address, customer PostalCode using Customers tables with matching records?*/

SELECT ContactName, CompanyName, Address,PostalCode from Customers;


/*Show the bookid,title,author from the books table?*/

select bookid,title,author from books;

